import React from 'react';
import styled from 'styled-components';
import MenuIcon from '@material/icons/menu';

function Header() {
	return (
		<Container>
			<a>
				<img src="/images/logo.svg" alt="logo" />
			</a>
			<Menu>
				<a href="#">Model S</a>
				<a href="#">Model Y</a>
				<a href="#">Model 3</a>
				<a href="#">Model X</a>
			</Menu>
			<RightMenu>
				<a href="#">Shop</a>
				<a href="#">Tesla Account</a>
			</RightMenu>
		</Container>
	);
}

export default Header;

const Container = styled.div`
	min-height: 60px;
	position: fixed;
	display: flex;
	align-items: center;
	padding: 0 20px;
	top: 0;
	left: 0;
	right: 0;
`;
const Menu = styled.div`
	display: flex;
	flex: 1;
	align-items: center;
	justify-content: center;
	a {
		font-weight: 600;
		text-transform: uppercase;
		padding: 0 10px;
		flex-wrap: nowrap;
	}
`;

const RightMenu = styled.div`
	a {
		font-weight: 600;
		text-transform: uppercase;
		padding: 0 10px;
		margin-right: 10px;
	}
`;
